import React, {useEffect} from 'react';
import {Link} from "react-router-dom";
import Map from "./map";
import {useSelector} from "react-redux";

export default function Footer(props) {
    const {categories} = useSelector((state) => state.categoryList.categories);

    useEffect(() => {
        console.log(categories);
    }, [categories])

    return <footer className="footer">
        <div className="container">
            <div className="row">
                <div className="col-md-6">
                    <h3 className="footer-headline">Glanve kategorije</h3>
                    <ul>
                        {categories?.length ?
                        categories.map(item => {
                            let link = `/kategorija/${item._id}`;
                            return <Link to={link}>
                                <li key={item._id}>{item.name}</li>
                            </Link>
                        }) :
                        ''}
                    </ul>
                </div>
                {/*<div className="col-md-6"></div>*/}
                <div className="col-md-6">
                    {/*<div className="rights">*/}
                    {/*   */}
                    {/*</div>*/}
                    <div className="contact">
                        <a href="tel:022/314-740"><p>022/314-740</p></a>
                        <a href="mailto:novomakexport@yahoo.com"><p>novomakexport@yahoo.com</p></a>
                        <a href="https://www.google.com/maps?ll=44.991588,20.157549&z=16&t=m&hl=en-GB&gl=RS&mapclient=embed&cid=3269410594426619850" target="_blank"><p>Kralja Petra I Karađorđevića 78, Stara Pazova 22300</p></a>

                        <p> Novomak Export d.o.o. | <i>Sva prava zadrzana</i> |</p>
                    </div>
                </div>
            </div>
        </div>
    </footer>
}
